// Code smell. This needs to match $desktop-column-width in main.scss
let isDesktop = () => document.body.offsetWidth > 1090
let isMobile = () => !isDesktop()

//
// Table of contents
//

function showTableOfContents() {
  document.querySelector('[table-of-contents-container]').style.display = 'block'
  document.body.classList.add('no-scroll')
  if (isMobile()) {
    showMobileTOCWorm()
  }
}

function hideTableOfContents() {
  document.querySelector('[table-of-contents-container]').style.display = 'none'
  document.body.classList.remove('no-scroll')
  if (isMobile()) {
    hideMobileTOCWorm()
  }
}

// For animated gifs, I bake them into this javascript file in base64, and set the src in JS.
// This method is guaranteed to get the GIF to play when you want (as soon as the src is set).
// If you need to update a gif, you can use https://base64.guru/converter/encode/image/gif
// Tool for making new gifs from pngs: https://ezgif.com/maker

//
// Init worm gifs in table of contents
//

if (isDesktop()) {
  let base64WormGif = ''
  document.querySelectorAll('.worm-link').forEach(el => {
    el.addEventListener('mouseenter', () => {
      el.querySelector('.worm-image').style.display = 'block'
      el.querySelector('.worm-image').src = `data:image/gif;base64,${base64WormGif}`
    })

    el.addEventListener('mouseleave', () => {
      el.querySelector('.worm-image').style.display = 'none'
      el.querySelector('.worm-image').src = ''
    })
  })
}

function showMobileTOCWorm() {
  let base64WormLeftGif = ''
  document.querySelectorAll('[worm-facing-left-mobile]').forEach(el => {
    el.src = `data:image/gif;base64,${base64WormLeftGif}`
  })
}

function hideMobileTOCWorm() {
  document.querySelectorAll('[worm-facing-left-mobile]').forEach(el => {
    el.src = ''
  }) 
}

