//
// Animate mushroom if webmon is active
//

const startMushroomAnimation = () => {
  document.querySelectorAll('[webmon-mushroom-black]').forEach(el => {
    el.src = `data:image/gif;base64,${base64BlackMushroomForeverGif}`
  })
  document.querySelectorAll('[webmon-mushroom-white]').forEach(el => {
    el.src = `data:image/gif;base64,${base64WhiteMushroomForeverGif}`
  })
}

let base64BlackMushroomForeverGif = ''
let base64WhiteMushroomForeverGif = ''
if (document.monetization) {
  document.monetization.addEventListener('monetizationstart', startMushroomAnimation)
}

//
// Give squiggles random rotations
//

let squiggles = document.querySelectorAll('.squiggles')
squiggles.forEach(squiggle => {
  squiggle.style.transform = `rotate(${Math.random() * 360}deg)`
})